const Import = ({ IMP }) => {
  IMP.request_pay({});
  return (
    <>
      <h1>test</h1>
    </>
  );
};

export const getServerSideProps = () => {
  const { IMP } = window;
  IMP.init("imp37098043");
  return IMP;
};

export default Import;
